class DTMF:  # 双音频拨号音
    hf = [1209, 1336, 1477, 1633]
    lf = [697, 770, 852, 941]
    kb = [['1', '2', '3', 'A'], ['4', '5', '6', 'B'], ['7', '8', '9', 'C'], ['*', '0', '#', 'D']]

    def getkey(self, lf=697, hf=1336, dev=True):
        if isinstance(lf, str): lf = int(lf)
        if isinstance(hf, str): hf = int(hf)
        if dev:
            lf = int(lf // 100)
            hf = int(hf // 100)
            tbl = [int(i // 100) for i in self.lf]
            tbh = [int(i // 100) for i in self.hf]
        else:
            tbl = self.lf
            tbh = self.hf
        return self.kb[tbl.index(lf)][tbh.index(hf)]

class Wdf:
    WdF = [  # 字频率矩阵
        0.0651738, 0.0124248, 0.0217339, 0.0349835, 0.1041442, 0.0197881,
        0.0158610, 0.0492888, 0.0558094, 0.0009033, 0.0050529, 0.0331490,
        0.0202124, 0.0564513, 0.0596302, 0.0137645, 0.0008606, 0.0497563,
        0.0515760, 0.0729357, 0.0225134, 0.0082903, 0.0171272, 0.0013692,
        0.0145984, 0.0007836]

    ordWdf = ['etaoinsrhldcumfpgwybvkxjqz', 'eariotnslcudpmhgbfywkvxzjq']

    @staticmethod
    def WdfDic(f=None):
        if f == None:
            f = Wdf.WdF
        return {chr(ord('a') + i): f[i] for i in range(len(f))}

    @staticmethod
    def getordWdf(f=None, ord=-1) -> dict:
        if f == None:
            f = Wdf.WdF
        iDic = Wdf.WdfDic(f)
        s = sorted(iDic.items(), key=lambda x: (ord) * x[1])
        return [k[0] for k in s]


